import AboutContent from "../components/about_components/AboutContent";
import Header from "../components/Header";
import sideBarImg from "../images/sidebarimg.jpeg";

const About = () => {
  const sideBarStyle = {
    backgroundImage: "url(" + sideBarImg + ")",
  };
  return (
    <>
      <Header />
      <div className="about-content-area flex flex-col gap-4">
        <div
          className="backgroundSidebarImg w-full h-32 bg-cover"
          style={sideBarStyle}
        ></div>
        <div className="main-about-content text-slate-50 bg-amber-600 ml-5 mr-5 md:ml-5 md:ml-10 md:mr-10 rounded pt-4 pb-4">
          <AboutContent />
        </div>
      </div>
    </>
  );
};

export default About;
